public Object doWork(Object value) throws IOException{
  if(null == value){
    return null;
  } else if (value instanceof Matrix) {

    
    Matrix matrix = (Matrix) value;
    double[][] data = matrix.getData();
    RealMatrix realMatrix = new Array2DRowRealMatrix(data);
    realMatrix = realMatrix.transpose();
    data = realMatrix.getData();

    
    List<Number> sums = new ArrayList(data.length);

    for(int i=0; i<data.length; i++) {
      double sum = 0;
      double[] row = data[i];
      for(int j=0; j<row.length; j++){
        sum+=row[j];
      }

      sums.add(sum);
    }

    return sums;
  } else {
    throw new IOException("Grand sum function only operates on a matrix");
  }
}

